/**
 * @param {number} purchaseAmount
 * @return {number}
 */
var accountBalanceAfterPurchase = function(purchaseAmount) {
    // Find the lower and higher multiples of 10
    var lowerMultiple = Math.floor(purchaseAmount / 10) * 10;
    var higherMultiple = Math.ceil(purchaseAmount / 10) * 10;

    // Choose the multiple that is closer, or the higher one if they are equally close
    var roundedAmount = (purchaseAmount - lowerMultiple) <= (higherMultiple - purchaseAmount) ? higherMultiple : lowerMultiple;

    // Subtract the rounded amount from the initial balance
    return 100 - roundedAmount;
};
